                    <div class=""modal-body"">
                        A) Kişisel Verilerin Korunması ve Veri Sorumlusu Kişisel verileriniz;
                        6698 sayılı Kişisel Verilerin Korunması Kanunu (KVKK), Kişisel Verileri Koruma Kurumu düzenlemeleri ve sair mevzuat hükümleri çerçevesinde işlenebilecek olup, ilgili mevzuat gereğince Şirketimiz kişisel verilerinizin hukuka aykırı olarak işlenmesini önleme, hukuka aykırı olarak erişilmesini önleme ve m");
                WriteLiteral(@"uhafazasını sağlama amacıyla, uygun güvenlik düzeyini temin etmeye yönelik tüm teknik ve idari tedbirleri almaktadır ŞEHREMİNİ ŞEHİR KURUMLARI SİYASET VE YÖNETİMİ ANONİM ŞİRKETİ ( “Şirket”) Veri Sorumlusu olarak, KVKK ve ilgili mevzuat kapsamında, kişisel verilerinizi mevzuata uygun olarak aşağıda yer alan bilgilendirme ve amaçlar kapsamında işleyebilmektedir.
                        <br />
                        B) Kişisel Verilerin İşlenme Amaçları
                        Bu formu doldururken tarafınızca iletilen kişisel verileriniz, erişim kayıtlarının yönetimi, mevzuattan kaynaklı yükümlülüklerimizin yerine getirilmesi ve kurumunuza verilecek hizmetin gerçekleştirilmesi amacı ile 6698 sayılı Kanun’un 5. ve 6. maddelerinde belirtilen kişisel veri işleme şartları ve amaçları ile sınırlı olarak da aktarılabilecektir.
                        <br />
                        C) İşlenen Kişisel Verilerin Kimlere ve Hangi Amaçla Aktarılabileceği
                        Toplanan kişisel verileriniz; yukarıda");
                WriteLiteral(@" belirtilen amaçların ve kurumunuza verilecek hizmetin gerçekleştirilmesi amacı ile sınırlı olmak üzere iş ortaklarımıza, hissedarlarımıza, iştiraklerimize, kanunen yetkili kamu kurumları ve özel hukuk kişilerine, 6698 sayılı Kanun’un 8. ve 9. maddelerinde belirtilen kişisel veri işleme şartları ve amaçları çerçevesinde aktarılabilecektir.
                        <br />
                        D) Kişisel Veri Toplamanın Yöntemi ve Hukuki Sebebi
                        Kişisel verileriniz Şirketimiz tarafından yukarıda; (b) ve (c) maddelerinde belirtilen hukuki sebebe dayanarak toplanmaktadır. Bu süreçte toplanan kişisel verileriniz, web üzerinden doldurduğunuz bu form aracılığıyla, ve çağrı merkezimiz üzerinden gerçekleştirilen görüşmeler aracılığıyla, sözlü olarak toplanmaktadır. Bahsi geçen kişisel verileriniz 6698 sayılı Kanun’un 5. ve 6. maddelerinde belirtilen kişisel veri işleme şartları ve amaçları kapsamında işbu Aydınlatma Metni’nin (b) ve (c) maddelerinde belirtilen amaçlarla da işlenebilmekte ve");
                WriteLiteral(@" aktarılabilmektedir.
                        <br />
                        E) Kişisel Verilerin İşlenmesine Dair Haklarınız
                        KVKK 11. Maddesi uyarınca Şirketimize başvurarak;
                        <br />
                        a. Kişisel verinizin işlenip işlenmediğini öğrenme,
                        b. Kişisel verileriniz işlenmişse buna ilişkin bilgi talep etme,
                        c. Kişisel verilerinizin işlenme amacını ve bunların amacına uygun kullanılıp kullanılmadığını öğrenme,
                        d. Yurt içinde veya yurt dışında kişisel verilerinizin aktarıldığı üçüncü kişileri bilme,
                        e. Kişisel verilerinizin eksik veya yanlış işlenmiş olması halinde bunların düzeltilmesini isteme,
                        f. Kanun ilgili maddesinde öngörülen şartlar çerçevesinde kişisel verilerinizi silinmesini veya yok edilmesini isteme
                        g. (e) ve (f) bentleri uyarınca yapılan işlemlerin, kişisel verilerin aktarıldığı üçün");
                WriteLiteral(@"cü kişilere bildirilmesini isteme,
                        h. İşlenen verilerinizin münhasıran otomatik sistemler vasıtasıyla analiz edilmesi suretiyle kişinin kendisi aleyhine bir sonucun ortaya çıkmasına itiraz etme,
                        i. Kişisel verilerin kanuna aykırı olarak işlenmesi sebebiyle zarara uğramanız halinde zararın giderilmesini talep etme, Haklarınız bulunmaktadır.
                        KVK Kanunu’nun 13. maddesinin 1. fıkrası gereğince, yukarıda belirtilen haklarınızı kullanmak ile ilgili talebinizi, yazılı veya Kişisel Verileri Koruma Kurulu’nun belirlediği diğer yöntemlerle Şirketimize iletebilirsiniz. Bu çerçevede Şirketimize KVK Kanunu’nun 11. maddesi kapsamında yapacağınız başvurularda yazılı olarak başvurunuzu ileteceğiniz kanallar ve usuller aşağıda açıklanmaktadır.
                        <br />
                        Yukarıda belirtilen haklarınızı kullanmak için kimliğinizi tespit edici gerekli bilgiler ile KVK Kanunu’nun 11. maddesinde belirtilen haklardan kullanmayı ");
